 @TheUltimateBlooper  We havent moved on from 8gb cards because a card like the 3070ti and 5060ti are only just powerful enough to have the lack of vram matter in a few games at max settings with a fairly minor visual quality loss from dropping texture quality.  The reality is that there arent that many games that you can't max out with 8gb, even at 1440p; Those you cant run just fine with altered settings, often still looking better than current gen consoles.

I've owned 680 2gb, 780sli(4gb), titan x maxwell (12gb), 3060 12gb, 3060ti and 4070ti.  The times vram has been an "issue" have been 0.  If any cards on the list were hitting vram limits, it was due to being maxed out and a simple settings change fixed it with almost no perceived visual loss.  It isnt great to see a 3070ti level card with only 8gb though.  The 3060ti was just slow enough to not care  about vram in 99% of games and the 4070ti only runs out in Indiana jones from my testing.

You just can do a lot with 8gb and the cost of 3gb modules to make 12gb models instead would be pointless due to being the same price as using double the 2gb chips. A 12gb 5060ti would likely cost just as much to produce as a 16gb 5060ti if rumors on 3gb module pricing is to be believed.

